import React from "react";
import { NavLink } from "react-router-dom";

function NavBar() {
  return (
    // Using the DaisyUI Navbar component classes
    <div className="navbar bg-neutral text-neutral-content">
      <div className="flex-1 px-2 mx-2">
        <span className="text-lg font-bold">
          Company Name
        </span>
      </div>
      <div className="flex-none hidden px-2 mx-2 lg:flex">
        <div className="flex items-stretch">
          <NavLink className="btn btn-ghost btn-sm rounded-btn" to="/">Roster</NavLink>
          <NavLink className="btn btn-ghost btn-sm rounded-btn" to="/employeeform">Add Associate</NavLink>
          <NavLink className="btn btn-ghost btn-sm rounded-btn" to="/executivesummary">Executive Summary</NavLink>
          <NavLink className="btn btn-ghost btn-sm rounded-btn" to="/about">About</NavLink>
          <NavLink className="btn btn-ghost btn-sm rounded-btn" to="/associatetable">Associate Schedules</NavLink>
          <NavLink className="btn btn-ghost btn-sm rounded-btn" to="/schedulebuilder">Schedule Build Optimizer</NavLink>
          <NavLink className="btn btn-ghost btn-sm rounded-btn" to="/allocationsummary">Department Allocation Optimizer</NavLink>
        </div>
      </div>
    </div>
  );
}

export default NavBar;
